import React from "react";
import logo from "./logo.svg";
import fontenay from "./fontenay.jpg";
import koh from "./koh.jpg";
import RuPauls from "./RuPauls.jpg";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="Split">
        <img src={RuPauls} className="imageEntre" alt="RuPauls" />
        <img src={fontenay} className="imageEntre" alt="fontenay" />
        <img
          src={koh}
          onmouseover="transit()"
          className="imageEntre"
          alt="denis"
        />
      </header>
    </div>
  );
}

function transit() {
  return <img src={koh} className="imageEntre transit" alt="denis" />;
}
export default App;
